import React, {useState} from 'react';
import { faThumbsUp, faThumbsDown, faComment } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome"
import { faStar } from "@fortawesome/free-regular-svg-icons"
import {  BrowserRouter as Router,Route, Routes, Link, useParams, Navigate} from 'react-router-dom'


function Hot(propz) {
 var dan = "/" + propz.name
 return ( 
    <Link to = {dan} onClick = {window.location.reload}>
        <div className = "hotgames">
	        <div class="M-game">
	        <img class = "anhgamehotnhat" src={propz.image}/>
	        <h3>{propz.name}</h3>	
	        </div>
	        <div class="M-game">{propz.theloai}</div>
	        <p>
                {propz.thumbnail}
            </p>
        </div>
    </Link>
    )
  }

  function HotNhi(propz) {
   var dan = "/" + propz.name
   return ( 
      <Link to = {dan} onClick = {window.location.reload}>
          <div className = "hotgames">
              <div class="M-game">
              <img class = "anhgamehotnhat" src={propz.image}/>
              <h3>{propz.name}</h3>	
              </div>
              <div class="M-game">{propz.theloai}</div>
              <p>
                  {propz.thumbnail}
              </p>
          </div>
      </Link>
      )
    }
  export default Hot;
